<body>

<div id="wheel" onclick="rotateToNextPlayer()"></div>
<div id="playerName"></div>
<div id="roundCounter">Round: 1</div>

<div id="background"></div>


<script>
  const angleMap = {
    'Aravine': 0,
    'Merlin': 60,
    'Dr3ad B3ar and Percy': 120,
    'Draxx': 180,
    'Cranberry': 240,
    'Jack': 300
  };
  
  const playerBackgrounds = {
    'Aravine': 'oceanBlueWhite', 
    'Merlin': 'forestGreen',
    'Dr3ad B3ar and Percy': 'metalRedGreenTeal',
    'Draxx': 'blueRedSilver',
    'Cranberry': 'cranberryRedBlackSilver',
    'Jack': 'whiteRedYellowWood'
  };

  let playerRolls = [];
  let currentPlayerIndex = 0;
  let roundsCompleted = 1;

  let input_flag = true;

// Adjusted window.onload and setPlayerRolls function
window.onload = setPlayerRolls;

function setPlayerRolls() {
    Object.keys(angleMap).forEach(player => {
      let roll;
      do {
        roll = prompt(`Enter the number rolled for ${player}:`, "");
      } while (!roll || isNaN(roll) || parseInt(roll) <= 0);
      playerRolls.push({ name: player, roll: parseInt(roll), angle: angleMap[player] });
    });

    // Sort player rolls
    playerRolls.sort((a, b) => b.roll - a.roll);

    input_flag = false; // Disable further input handling
    displayCurrentPlayer(); // Directly display the first player after sorting
}


  function rotateToNextPlayer() {
    currentPlayerIndex++;
    if (currentPlayerIndex >= playerRolls.length) {
      currentPlayerIndex = 0;
      roundsCompleted++;
    }
    
    displayCurrentPlayer();
  }

  function displayCurrentPlayer() {
  const player = playerRolls[currentPlayerIndex];
  document.getElementById('playerName').innerHTML = `${player.name}<br>(Rolled: ${player.roll})`;
  document.getElementById('roundCounter').textContent = `Round: ${roundsCompleted}`;

  // Rotate the wheel
  var wheel = document.getElementById('wheel');
  wheel.style.transform = 'rotate(' + player.angle + 'deg)';

  // Start transition for background
  var background = document.getElementById('background');
  // Fade out
  background.style.opacity = '0';

  // After opacity transition ends, change the background and fade back in
  setTimeout(() => {
    background.className = playerBackgrounds[player.name]; // Apply the class to background div
    background.style.opacity = '1';
  }, 450); // This delay should match your CSS transition time
}


  // Initialize the game by setting player rolls
  window.onload = setPlayerRolls;

  // Event listener for keydown event on the window
  window.addEventListener('keydown', function(event) {
    // Check if the pressed key is spacebar (32) or enter (13)

    if (input_flag == true){
      return;
    }else if (event.keyCode === 32 || event.keyCode === 13) {
      rotateToNextPlayer();
      event.preventDefault(); // Prevent the default action of the spacebar or enter key
    }
  });

</script>


</body>
</html>
